// import Link from 'next/link'
import {connect} from 'react-redux'
import ClockControl from '../components/clock/ClockControl'

function Page ({lastUpdate}) {
    return (
        <div>
           <ClockControl lastUpdate={lastUpdate} />
        </div>
    )
}
export default connect()(Page)
